import className from "classnames/bind";

import styles from "./ItempProject.module.scss";


const cx = className.bind(styles);

function ItemProject({item, show, hidlen = "show"}){

    const handleClose = (e) => {
        // Ngăn chặn sự lan truyền của sự kiện
        e.stopPropagation();
        hidlen(null);
    }

    return (
        <section className={cx("warpper")}>
            {
               show !== null && show === item._id ? 
                <section className={cx("desProject", {'visible': true})}>
                    <article className = {cx("imageDesProject")}>
                        <img src={item.Image[1]} alt="imgProject"/>
                    </article>
                    <section className = {cx("contentDesProject")}>
                        <section className = {cx("itemContentDesProject")}>
                            <h2>Introduce</h2>
                            <p>{item.Introduce}</p>
                            <h2>Technology</h2>
                            <ul>
                            {item.Technology.map((itemTechnology, indexTechnology) => {
                                return (
                                    <li key={indexTechnology}>{itemTechnology}</li>
                                )
                            })}
                            </ul>
                            <h2>Objects included in the project</h2>
                            <ul>
                                {item.ObjectInProject.map((itemObjectInProject, indexObjectInProject) => {
                                    return (
                                        <li key={indexObjectInProject}>{itemObjectInProject}</li>
                                    )
                                })}
                            </ul>
                            <a href={`${item.LinkProject}`}>
                                <button>Experience now</button>
                            </a>
                        </section>
                        <article className = {cx("icontDesProject")}>
                             <i onClick={(e) => handleClose(e)} className="bi bi-x-circle"></i>
                        </article>
                    </section>
                </section>     
                :        
                <section className={cx("desProject", {'visible': false})}>
                    <article className = {cx("imageDesProject")}>
                        <img src={item.Image[1]} alt="imgProject"/>
                    </article>
                    <section className = {cx("contentDesProject")}>
                        <section className = {cx("itemContentDesProject")}>
                            <h2>Introduce</h2>
                            <p>{item.Introduce}</p>
                            <h2>Technology</h2>
                            <ul>
                            {item.Technology.map((itemTechnology, indexTechnology) => {
                                return (
                                    <li key={indexTechnology}>{itemTechnology}</li>
                                )
                            })}
                            </ul>
                            <h2>Objects included in the project</h2>
                            <ul>
                                {item.ObjectInProject.map((itemObjectInProject, indexObjectInProject) => {
                                    return (
                                        <li key={indexObjectInProject}>{itemObjectInProject}</li>
                                    )
                                })}
                            </ul>
                            <a href={`${item.LinkProject}`}>
                                <button>Experience now</button>
                            </a>
                        </section>
                        <article className = {cx("icontDesProject")}>
                            <i onClick={() => {handleClose()}} className="bi bi-x-circle"></i>
                        </article>
                    </section>
                </section>     
            }
        </section>
    )
}

export default ItemProject;
